  input: TEXT,"F3A","","Ms. Balderama,Please allow this letter to confirm our previous
    telephone conversations responding to your Request for Additional Information
    Letter dated March 18, 2003.  With regard to your request that disbursements listed
    on the 4/1/02-6/30/02 report failed to include complete information, be advised
    that I have reviewed the report and have made entered the information requested
    and is attached to the amendment herewith.  However, if there is any item that
    you specifically require, do not hesitate to contact . With regard to your request
    that contributions from political committees fail to include recognizable names.
    Be advised that I have made the necessary adjustments and are reflected in the
    amendment herewith.   In relation to your inquiry regarding the cash flow balance
    and column B discrepencies, be advised that I have located the errors, which were
    software related, made the necessary adjustments and are reflected in the amendments
    herewith. Additionally, as discussed, I have amended my reports dating back to
    the 2001 midyear forward in order to have the cash equal the balance on hand at
    the end of each report.  I trust these amendments satisfy your inquiries, however,
    feel free to contact me should there be anything else you require.Very truly yours,   SCOTT
    G. KAUFMAN"
